import React, { useState } from 'react';
import './adminaccess.css';

const AdminLogin = ({ closeModal }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you can add logic to verify the admin credentials
    console.log('Admin Username:', username);
    console.log('Admin Password:', password);
    
    // Close modal after successful submission (this can be conditional if credentials are correct)
    closeModal();
  };

  return (
    <div className="admin-modal">
      <h2>Admin Login</h2>
        <span className="admin-close" onClick={closeModal}>&times;</span>
        <form onSubmit={handleSubmit}>
        <div className="input-box">
            <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} required />
            <i className="bx bxs-user"></i>
        </div>
        <div className="input-box">
            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} required/>
            <i className="bx bxs-lock-alt"></i>
        </div>
        <div className="remember-forget">
          <label>
            <input type="checkbox"/>
            Remember me
          </label>
          <a href="#"> Forgot Password?</a>
        </div>
          <button type="submit" className="btn">Login</button>
        <div className="register-link">
          <p>Don't have an account? <a href="#">Register</a></p>
        </div>
      </form>
      
    </div>
  );
};

export default AdminLogin;
